import GetShipments from "./Queries/GetShipments";

const Shipments = () => {
  const { error, data, loading } = GetShipments(1);

  useEffect(() => {
    console.log(data);
  }, [loading]);

  if (loading) {
    return <p>Loading...</p>;
  }
  return (
    <div>
      {data.user.shipments &&
        data.user.shipments.map((shipment, key) => (
          <div className="shipment">
            <p key={key}>{shipment.id}</p>
            <div className="btns">
              <button>login</button>
              <button>login</button>
            </div>
          </div>
        ))}
    </div>
  );
};

export default Shipments;
